import React from 'react'

function User(props) {
    const users=props.users;
    return (
        <div>
            {users.map((user)=>{
                <div>
                <h1>{user.name}</h1>
                <h1>{user.roll}</h1>
                </div>
            })}
        </div>
    )
}

export default User
